interface IProps {
  topics: string[];
}
const ItemTopics: React.FC<IProps> = ({ topics }) => {
  return (
    <div className="repo-item__topics">
      {topics.map((topic) => {
        return (
          <a>
            <div className="topic">{topic}</div>
          </a>
        );
      })}
    </div>
  );
};

export default ItemTopics;
